(5670, 'D1A51654-7CA4-464A-8985-5502AE75196B', 'You are welcome. I did speak with nathan about it on the way to the airport. ', 'David', 'Nitzan', '2024-06-19T08:12:17.209000'),
(5626, 'D55D7B89-BD6A-48F0-9360-4840FC133A75', 'Thank you. Means a lot to see him model what being a strong man and husband look like. To acknowledge when you’ve made a mistake and be gracious about it. I️ think those are incredibly important lessons to showcase and I’m glad he got to see all of you in this way.', 'Nitzan', 'David', '2024-06-19T08:13:49.919925'),
