(5708, 'A0B303D6-D487-48E7-ABAE-CCA3A48C3859', 'So we should think about what we want to feed orli when she gets home. She gets super hungry so I️ want to give her dinner before the movie. ', 'Nitzan', 'David', '2024-06-19T08:14:33.828431'),
(5647, '98A7FAFB-A690-44A1-A265-FEC0D51EF398', 'One option one option I was thinking about for Matt is to get his help to set up the financial plan of making changes and consider an arrangement where we pay him for financial advisory services on an ad hoc basis when we need it I think there is value for us to have him on tap as a financial advisor, but if he is not actively making investments, I don’t think it makes sense to pay him. A percentage basis doesn’t make sense.', 'David', 'Nitzan', '2024-06-19T08:22:07.664000'),
